pragma solidity ^0.6.11;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./IJLoanCommons.sol";
import "./IJLoanEthDeployer.sol";
import "./IJLoanTokenDeployer.sol";

contract JFactory is Ownable, IJLoanCommons { 
    using SafeMath for uint256;

    address public constant ZERO_ADDRESS = 0x0000000000000000000000000000000000000000;

    IJLoanEthDeployer public ethDeplContract;
    IJLoanTokenDeployer public tokenDeplContract;

    uint public loanID;
    mapping(uint => address) internal deployedLoans;

    struct Pair {
        string pairName;
        uint pairValue;
        uint8 pairDecimals;
        address baseAddress;
        uint8 baseDecimals;
        address quoteAddress;
        uint8 quoteDecimals;
    }
    mapping(uint => Pair) public pairs;
    uint public pairCounter;

    //mapping(uint => address) public tokenContractAddresses;
    uint public contractCounter;

    params public generalParams;
    feesParams public generalFees;

    uint public factoryDeployBlock;
    uint public lastDepositBlock;

    event NewPair(uint indexed _pairId, string _pairName);
    event NewPrice(uint indexed pairId, string indexed pairName, uint pairValue, uint8 pairDecimals);
    event NewPairDecimals(uint indexed pairId, string indexed pairName, uint8 baseDecimals, uint8 quoteDecimals);
    event NewPairAddresses(uint indexed pairId, string indexed pairName, address baseAddress , address quoteAddress);
    event NewEthLoanCreated(
        uint indexed loanId,
        address indexed sender,
        address indexed newLoan,
        uint value,
        address collateralTokenAddress
    );
    event NewTokenLoanCreated(
        uint indexed loanId,
        address indexed sender,
        address indexed newLoan,
         address collateralTokenAddress
    );

    constructor (address _ethDepl, address _tokenDepl) public {
        generalParams.earlySettlementWindow = 540000;
        generalParams.foreclosureWindow = 18000;
        generalParams.requiredCollateralRatio = 200;
        generalParams.foreclosingRatio = 150;
        generalParams.instantForeclosureRatio = 120;
        generalParams.minRpbRate = (10 ** 9); //0.000000001 in eth an all tokens with 18 decimals
        generalParams.ethDeployerAddress = _ethDepl;
        generalParams.tokenDeployerAddress = _tokenDepl;
        ethDeplContract = IJLoanEthDeployer(_ethDepl);
        tokenDeplContract = IJLoanTokenDeployer(_tokenDepl);
        generalParams.factoryAddress = address(this);
        generalFees.factoryFees = 5;
        generalFees.earlySettlementFee = 1080000; 
        generalFees.userRewardShare = 80;
        generalFees.vaultShare = 20;
        generalFees.undercollateralizedForeclosingMultiple = 1000;
        generalFees.atRiskForeclosedMultiple = 3000;
        generalFees.cancellationFees = 3;
        pairCounter = 0;
        loanID = 0;
        factoryDeployBlock = block.number;
    }

    /**
    * @dev set a new address for ETH deployer contract
    * @param _ethDepl new address
    */
    function setEthDeployerAddress(address _ethDepl) external onlyOwner {
        require(_ethDepl != address(0), "address not allowed");
        require(_ethDepl != generalParams.ethDeployerAddress, "new address is the same as the old one");
        generalParams.ethDeployerAddress = _ethDepl;
        ethDeplContract = IJLoanEthDeployer(_ethDepl);
    }

    /**
    * @dev set a new address for token deployer contract
    * @param _tokenDepl new address
    */
    function setTokenDeployerAddress(address _tokenDepl) external onlyOwner {
        require(_tokenDepl != address(0), "address not allowed");
        require(_tokenDepl != generalParams.tokenDeployerAddress, "new address is the same as the old one");
        generalParams.tokenDeployerAddress = _tokenDepl;
        tokenDeplContract = IJLoanTokenDeployer(_tokenDepl);
    }

    /**
    * @dev set a new pair
    * @param _pairName string describing the pair (i.e. ETHDAI)
    * @param _price price of the pair
    * @param _pairDecimals number of decimals for pair
    */
    function setNewPair(string memory _pairName, uint _price, uint8 _pairDecimals, 
                address _baseAddress, uint8 _baseDecimals, address _quoteAddress, uint8 _quoteDecimals) public onlyOwner {
        // eth vs stable coin expressed in 6 or more decimals
        require(pairCounter >= 0, "Pairs counter not ok, please set to a valid value!");
        pairs[pairCounter] = Pair({pairName: _pairName, pairValue: _price, pairDecimals: _pairDecimals, 
                baseAddress: _baseAddress, baseDecimals: _baseDecimals, quoteAddress: _quoteAddress, quoteDecimals: _quoteDecimals});
        emit NewPair(pairCounter, _pairName);
        pairCounter = pairCounter.add(1);
    }

    /**
    * @dev set a price for the specified pair
    * @param _pairId number of the pair
    * @param _price price of the pair
    * @param _pairDecimals number of decimals for pair
    */
    function setPairValue(uint _pairId, uint _price, uint8 _pairDecimals) public onlyOwner {
        // eth vs stable coin expressed in 6 or more decimals
        require(_pairId <= pairCounter, "pair does not exists");
        pairs[_pairId].pairValue = _price;
        pairs[_pairId].pairDecimals = _pairDecimals;
        emit NewPrice(_pairId, pairs[_pairId].pairName, pairs[_pairId].pairValue, pairs[_pairId].pairDecimals);
    }

    /**
    * @dev set a base and quote decimals for the specified pair
    * @param _pairId number of the pair
    * @param _baseAddress base address of the pair
    * @param _quoteAddress quote address for pair
    */
    function setBaseQuoteAddresses(uint _pairId, address _baseAddress, address _quoteAddress) public onlyOwner {
        // eth vs stable coin expressed in 6 or more decimals
        require(_pairId <= pairCounter, "pair does not exists");
        pairs[_pairId].baseAddress = _baseAddress;
        pairs[_pairId].quoteAddress = _quoteAddress;
        emit NewPairAddresses(_pairId, pairs[_pairId].pairName, pairs[_pairId].baseAddress, pairs[_pairId].quoteAddress);
    }

    /**
    * @dev set a base and quote decimals for the specified pair
    * @param _pairId number of the pair
    * @param _baseDecimals base decimals of the pair
    * @param _quoteDecimals quote decimals for pair
    */
    function setBaseQuoteDecimals(uint _pairId, uint8 _baseDecimals, uint8 _quoteDecimals) public onlyOwner {
        // eth vs stable coin expressed in 6 or more decimals
        require(_pairId <= pairCounter, "pair does not exists");
        pairs[_pairId].baseDecimals = _baseDecimals;
        pairs[_pairId].quoteDecimals = _quoteDecimals;
        emit NewPairDecimals(_pairId, pairs[_pairId].pairName, pairs[_pairId].baseDecimals, pairs[_pairId].quoteDecimals);
    }

    /**
    * @dev get a pair price
    * @param _pairId number of the pair
    * @return price of the pair
    */
    function getPairValue(uint _pairId) public view returns (uint){
        // eth vs stable coin expressed in 6 or more decimals
        require(_pairId <= pairCounter, "pair does not exists");
        return pairs[_pairId].pairValue;
    }

    /**
    * @dev get a pair name
    * @param _pairId number of the pair
    * @return name of the pair
    */
    function getPairName(uint _pairId) external view returns (string memory){
        require(_pairId <= pairCounter, "pair does not exists");
        return pairs[_pairId].pairName;
    }

    /**
    * @dev get a pair decimals
    * @param _pairId number of the pair
    * @return decimals of the pair
    */
    function getPairDecimals(uint _pairId) external view returns (uint8){
        // eth vs stable coin expressed in 6 or more decimals
        require(_pairId <= pairCounter, "pair does not exists");
        return pairs[_pairId].pairDecimals;
    }

    /**
    * @dev get a pair base decimals
    * @param _pairId number of the pair
    * @return number of base currency decimals
    */
    function getPairBaseDecimals(uint _pairId) external view returns (uint8){
        require(_pairId <= pairCounter, "pair does not exists");
        return pairs[_pairId].baseDecimals;
    }

    /**
    * @dev get a pair quote decimals
    * @param _pairId number of the pair
    * @return number of quote currency decimals
    */
    function getPairQuoteDecimals(uint _pairId) external view returns (uint8){
        require(_pairId <= pairCounter, "pair does not exists");
        return pairs[_pairId].quoteDecimals;
    }

    /**
    * @dev math round up
    * @param numerator numerator
    * @param denominator denominator
    * @param precision precision
    * @return number of quote currency decimals
    */
    function roundUp(uint numerator, uint denominator, uint precision) public pure returns (uint) {
         // caution, check safe-to-multiply here
        uint _numerator  = numerator.mul(10 ** (precision.add(1)));
        // with rounding of last digit
        uint _quotient =  ((_numerator.div(denominator)).add(5)).div(10);
        return _quotient;
    }

    /**
    * @dev math round down
    * @param numerator numerator
    * @param denominator denominator
    * @param precision precision
    * @return number of quote currency decimals
    */
    function roundDn(uint numerator, uint denominator, uint precision) public pure returns (uint) {
         // caution, check safe-to-multiply here
        uint _numerator  = numerator.mul(10 ** (precision.add(1)));
        // with rounding of last digit
        uint _quotient =  ((_numerator.div(denominator)).sub(5)).div(10);
        return _quotient;
    }

    /**
    * @dev calculate fees on collateral amount
    * @param _collAmount collateral amount
    * @return amount of collateral fees
    */
    function calculateCollFeesOnActivation(uint _collAmount) public view returns (uint) {
        return roundUp(_collAmount.mul(generalFees.factoryFees), 1000, 0);
    }

    /**
    * @dev get the amount of collateral needed to have stable coin amount (no fees)
    * @param _pairId number of the pair
    * @param _askAmount amount in stable coin the borrower would like to receive
    * @return amount of collateral the borrower needs to send
    */
    function calcMinCollateralAmount(uint _pairId, uint _askAmount) public view returns (uint){
        // i.e. eth / dai price, let's say 347.85, for every ETH can ask 347.85 / 2 = 173.925 dai
        // NB: amount and price expressed with same number of decimals
        uint price = getPairValue(_pairId);
        uint minCollEthAmount = roundUp(_askAmount.mul(generalParams.requiredCollateralRatio).div(100).mul(10**uint(pairs[_pairId].pairDecimals)), price, 0);
        if (pairs[_pairId].baseDecimals >= pairs[_pairId].quoteDecimals) {
            uint diffBaseQuoteDecimals = uint(pairs[_pairId].baseDecimals).sub(uint(pairs[_pairId].quoteDecimals));
            minCollEthAmount = minCollEthAmount.mul(10 ** diffBaseQuoteDecimals).add(5); //add 5 to be sure evrything is ok
        } else {
            uint diffBaseQuoteDecimals = uint(pairs[_pairId].quoteDecimals).sub(uint(pairs[_pairId].baseDecimals));
            minCollEthAmount = minCollEthAmount.div(10 ** diffBaseQuoteDecimals).add(5); //add 5 to be sure evrything is ok
        }
        return minCollEthAmount;
    }

    /**
    * @dev get the amount of collateral needed to have stable coin amount, with fees
    * @param _pairId number of the pair
    * @param _askAmount amount in stable coin the borrower would like to receive
    * @return amount of collateral the borrower needs to send
    */
    function calcMinCollateralWithFeesAmount(uint _pairId, uint _askAmount) public view returns (uint){
        // i.e. eth / dai price, let's say 347.85, for every ETH can ask 347.85 / 2 = 173.925 dai
        // NB: amount and price expressed with same number of decimals
        uint price = getPairValue(_pairId);
        uint minCollEthAmount = roundUp(_askAmount.mul(generalParams.requiredCollateralRatio).div(100).mul(10**uint(pairs[_pairId].pairDecimals)), price, 0);
        uint feesCollAmount = calculateCollFeesOnActivation(minCollEthAmount);
        uint totalCollAmountWithFees = minCollEthAmount.add(feesCollAmount); 
        if (pairs[_pairId].baseDecimals >= pairs[_pairId].quoteDecimals) {
            uint diffBaseQuoteDecimals = uint(pairs[_pairId].baseDecimals).sub(uint(pairs[_pairId].quoteDecimals));
            totalCollAmountWithFees = totalCollAmountWithFees.mul(10 ** diffBaseQuoteDecimals).add(5); //add 5 to be sure evrything is ok
        } else {
            uint diffBaseQuoteDecimals = uint(pairs[_pairId].quoteDecimals).sub(uint(pairs[_pairId].baseDecimals));
            totalCollAmountWithFees = totalCollAmountWithFees.div(10 ** diffBaseQuoteDecimals).add(5); //add 5 to be sure evrything is ok
        }
        return totalCollAmountWithFees;
    }

    /**
    * @dev get the amount of stable coin that a borrower could receive in front of a collateral amount (no fees)
    * @param _pairId number of the pair
    * @param _collAmount amount in collateral unit the borrower could receive with that aount of collateral
    * @return amount of stable coins the borrower could receive
    */
    function calcMaxStableCoinAmount(uint _pairId, uint _collAmount) public view returns (uint){
        // i.e. eth / dai price, let's say 347.85, for every ETH can ask 347.85 / 2 = 173.925 dai
        // NB: amount and price expressed with same number of decimals
        uint price = getPairValue(_pairId);
        uint askAmount = roundDn(_collAmount.div(generalParams.requiredCollateralRatio).mul(100).mul(price), 10 ** uint(pairs[_pairId].pairDecimals), 0);
        if (pairs[_pairId].baseDecimals >= pairs[_pairId].quoteDecimals) {
            uint diffBaseQuoteDecimals = uint(pairs[_pairId].baseDecimals).sub(uint(pairs[_pairId].quoteDecimals));
            askAmount = askAmount.div(10 ** diffBaseQuoteDecimals).sub(1); //subtract 1 to be sure evrything is ok
        } else {
            uint diffBaseQuoteDecimals = uint(pairs[_pairId].quoteDecimals).sub(uint(pairs[_pairId].baseDecimals));
            askAmount = askAmount.mul(10 ** diffBaseQuoteDecimals).sub(1); //subtract 1 to be sure evrything is ok
        }
        return askAmount;
    }

    /**
    * @dev get the amount of stable coin that a borrower could receive in front of a collateral amount
    * @param _pairId number of the pair
    * @param _collAmount amount in collateral unit the borrower could receive with that aount of collateral
    * @return amount of stable coins the borrower could receive
    */
    function calcMaxStableCoinWithFeesAmount(uint _pairId, uint _collAmount) public view returns (uint){
        // i.e. eth / dai price, let's say 347.85, for every ETH can ask 347.85 / 2 = 173.925 dai
        // NB: amount and price expressed with same number of decimals
        uint price = getPairValue(_pairId);
        uint feesCollAmount = calculateCollFeesOnActivation(_collAmount);  // fees amount
        uint collFeesDeducted = _collAmount.sub(feesCollAmount);  // available amount after fees deduction
        uint collAvailable = roundDn(collFeesDeducted.div(generalParams.requiredCollateralRatio).mul(100).mul(price), 10 ** uint(pairs[_pairId].pairDecimals), 0);
        uint askAmountWithFees = collAvailable.sub(feesCollAmount);
        if (pairs[_pairId].baseDecimals >= pairs[_pairId].quoteDecimals) {
            uint diffBaseQuoteDecimals = uint(pairs[_pairId].baseDecimals).sub(uint(pairs[_pairId].quoteDecimals));
            askAmountWithFees = askAmountWithFees.div(10 ** diffBaseQuoteDecimals).sub(1); //subtract 1 to be sure evrything is ok
        } else {
            uint diffBaseQuoteDecimals = uint(pairs[_pairId].quoteDecimals).sub(uint(pairs[_pairId].baseDecimals));
            askAmountWithFees = askAmountWithFees.mul(10 ** diffBaseQuoteDecimals).sub(1); //subtract 1 to be sure evrything is ok
        }
        return askAmountWithFees;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setEarlySettlementWindow (uint _value) external onlyOwner {
        generalParams.earlySettlementWindow = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setForeclosureWindow (uint _value) external onlyOwner {
        generalParams.foreclosureWindow = _value;
    }

    function setForeclosureRatio(uint _value) external onlyOwner {
        generalParams.foreclosingRatio = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setInstantForeclosureRatio (uint _value) external onlyOwner {
        generalParams.instantForeclosureRatio = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setMinRpbRate (uint _value) external onlyOwner {
        generalParams.minRpbRate = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setRequiredCollateralRatio (uint _value) external onlyOwner {
        generalParams.requiredCollateralRatio = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setFactoryFees (uint _value) external onlyOwner {
        generalFees.factoryFees = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setEarlySettlementFee (uint _value) external onlyOwner {
        generalFees.earlySettlementFee = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setUserRewardShare (uint _value) external onlyOwner {
        generalFees.userRewardShare = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setVaultShares (uint _value) external onlyOwner {
        generalFees.vaultShare = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setUndercollateralizedForeclosingMultiple (uint _value) external onlyOwner {
        generalFees.undercollateralizedForeclosingMultiple = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setAtRiskForeclosedMultiple (uint _value) external onlyOwner {
        generalFees.atRiskForeclosedMultiple = _value;
    }

    /**
    * @dev set params
    * @param _value set new param
    */
    function setCancellationFees (uint _value) external onlyOwner {
        generalFees.cancellationFees = _value;
    }

    /**
    * @dev get all general params
    * @return param struct
    */
    function getGeneralParams() external view returns (params memory){
        return generalParams;
    }

    /**
    * @dev get all general params
    * @return param struct
    */
    function getGeneralFees() external view returns (feesParams memory){
        return generalFees;
    }

    /**
    * @dev create a new loan with eth as collateraland set the address in the mapping
    * @param _pairId number of the pair interested in the loan contract
    * @param _borrowedAskAmount amount in stable coin the borrower would like to receive
    * @param _rpbRate RPB rate the borrower will pay 
    * @return address of the new contract
    */
    function createNewEthLoan(uint _pairId, 
                uint _borrowedAskAmount, 
                uint _rpbRate) public payable returns (address) {
        require(msg.sender!=address(0), "Sender address not allowed");
        // in wei
        uint minCollateralEth = calcMinCollateralWithFeesAmount(_pairId, _borrowedAskAmount);
        require((msg.sender).balance >= minCollateralEth, "Caller balance too low");
        require(msg.value >= minCollateralEth, "Please send more ethers");
        address _quoteAddress = pairs[_pairId].quoteAddress;
        address newEthLoan = ethDeplContract.deployNewEthLoanContract{value: msg.value}
                    (msg.sender, loanID, _pairId, _borrowedAskAmount, _rpbRate, address(this), _quoteAddress);
        deployedLoans[loanID] = newEthLoan;
        emit NewEthLoanCreated(loanID, msg.sender, newEthLoan, msg.value, address(0));
        loanID = loanID.add(1);
        contractCounter = contractCounter.add(1);
        return newEthLoan;
    }

    /**
    * @dev create a new loan and set the address in the mapping
    * @param _pairId number of the pair interested in the loan contract
    * @param _borrowedAskAmount amount in stable coin the borrower would like to receive
    * @param _rpbRate RPB rate the borrower will pay 
    * @return address of the new contract
    */
    function createNewTokenLoan(uint _pairId, 
                uint _borrowedAskAmount, 
                uint _rpbRate) public returns (address) {
        require(msg.sender!=address(0), "Sender address not allowed");
        // in wei
        uint totalCollateralTokens = calcMinCollateralWithFeesAmount(_pairId, _borrowedAskAmount);
        require(IERC20(pairs[_pairId].baseAddress).balanceOf(msg.sender) >= totalCollateralTokens, "Caller balance too low");
        uint256 allowance = IERC20(pairs[_pairId].baseAddress).allowance(msg.sender, generalParams.tokenDeployerAddress);  //check the allowance on the deployer
        require(allowance >= totalCollateralTokens, "Check the token allowance");
        uint contractCollateralAmount = calcMinCollateralWithFeesAmount(_pairId, _borrowedAskAmount);
        address _baseAddress = pairs[_pairId].baseAddress;
        address _quoteAddress = pairs[_pairId].quoteAddress;
        address newTokenLoan = tokenDeplContract.deployNewTokenLoanContract(msg.sender, loanID, _pairId, _borrowedAskAmount, _rpbRate, 
                    address(this), _baseAddress, _quoteAddress, contractCollateralAmount);
        deployedLoans[loanID] = newTokenLoan;
        emit NewTokenLoanCreated(loanID, msg.sender, newTokenLoan, _baseAddress);
        loanID = loanID.add(1);
        contractCounter = contractCounter.add(1);
        return newTokenLoan;
    }


    /**
    * @dev get all deployers addresses
    * @return addresses of the deployer
    */
    function getEnvironmentDeployers() external view returns(address, address) {
        return (address(ethDeplContract), address(tokenDeplContract));
    }

    /**
    * @dev get a single loan address deployed by the factory
    * @return loan contract address
    */
    function getDeployedLoan(uint _idx) external view returns (address) {
        return deployedLoans[_idx];
    }

}

